import React from 'react'
import { View, Text, StyleSheet  } from 'react-native'

export function Home() {
  return(
    
    <View style={{
      flex:1,
      justifyContent: "center",
      alignItems:'center'
    }}>
      <Text>React Native</Text>
      <Text>Nathan Firmino</Text>
    </View>
    
  )
}
